INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (1, 'Agronomi su istraživali potrošnju kisika dviju sorta pšenice pri različitim temperaturama. U postavljenome pokusu zrna pšenice obiju sorta klijala su na vlažnim papirnatim ručnicima u istim uvjetima. Nakon što su biljke isklijale, mjerena je potrošnja kisika sorta A i B na temperaturama 7 °C i 17 °C u vremenskim intervalima od 20, 40, 60 i 80 minuta. Pozorno promotrite rezultate istraživanja navedene u tablici.', null, 255);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (2, 'Agronomi su istraživali potrošnju kisika dviju sorta pšenice pri različitim temperaturama. U postavljenome pokusu zrna pšenice obiju sorta klijala su na vlažnim papirnatim ručnicima u istim uvjetima. Nakon što su biljke isklijale, mjerena je potrošnja kisika sorta A i B na temperaturama 7 °C i 17 °C u vremenskim intervalima od 20, 40, 60 i 80 minuta. Pozorno promotrite rezultate istraživanja navedene u tablici.', null, 256);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (3, 'Bijeli je fosfor pri sobnoj temperaturi vrlo reaktivna, otrovna i samozapaljiva čvrsta tvar. Reakcijom 11,5 g fosfora s ( 11,2 dm^3 ) klora pri normalnim uvjetima (p = 101 kPa, t = 0 °C) dobiveno je 42,6 g fosforova(III) klorida. Promjena je prikazana zadanom jednadžbom kemijske reakcije. P4 + 6 Cl2 → 4 PCl3', null, null);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (4, 'Burmanski piton vrsta je zmije specifičnoga procesa razmnožavanja. Ženke te vrste tijekom inkubacije tijelom obaviju jaja pri čemu učestalo stežu mišiće, što nazivamo drhtanje. Pozorno promotrite sliku na kojoj su prikazani rezultati istraživanja potrošnje kisika tijekom stezanja mišića ženke burmanskoga pitona u procesu inkubiranja jaja pri stalnoj temperaturi okoliša.', null, 257);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (5, 'Crnu boju krzna psa koker španijela određuje dominantan gen B, a crvenu boju recesivni gen b. Jednobojno krzno određuje dominantan gen D, a pjegavo krzno recesivni gen d. Ti su geni smješteni na autosomima i nisu vezani.', null, null);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (6, 'Dijagram prikazuje ovisnost topljivosti litijeva sulfata, Li2SO4 o temperaturi.', null, 258);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (7, 'Elektrokemijski članak u kojemu se kemijska energija pretvara u električnu energiju naziva se galvanski članak.', null, null);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (8, 'Geni za tumorske supresore odgovorni su za prirodnu zaštitu od tumora.', null, null);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (9, 'Match each message (1-5) and its meaning (A-F). There is one letter that you do not need. Mark your answer on the answer sheet. There is an example at the beginning (0).', null, 259);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (10, 'Na slici je prikazan pokus u kojemu su se učenici koristili biljkom lončanicom. Površinu zemlje prekrili su folijom, a zatim su cijelu biljku prekrili staklenim zvonom. Rub između staklene podloge i staklenoga zvona premazali su vazelinom. Biljku su ostavili na osvijetljenome mjestu tijekom jednoga dana.', null, 260);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (11, 'Nasljednu onihoosteodisplaziju karakteriziraju poteškoće u razvoju noktiju, kostiju i zglobova. Tu bolest uzrokuje dominantni alel (D), a zdravo stanje određuje recesivni alel (d). Geni odgovorni za bolest nalaze se na devetome kromosomu na kojemu su i geni za krvne grupe AB0 sustava.', null, null);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (12, 'Obalna sekvoja biljna je vrsta koja je prirodni heksaploid. Pretpostavlja se da se razvila iz diploidnih predaka (2n = 22) uslijed mutacija za vrijeme mejoze.', null, null);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (13, 'Od Ivanove kuće do grada vodi ravna biciklistička staza. Ivan se od 9.00 do 14.00 sati vozio po toj stazi i odmarao se kao što je prikazano na dijagramu.', null, 261);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (14, 'Otopina pripremljena otapanjem 24,0 g šećera u 100,0 g vode zaledi se pri −3,0 °C.', null, null);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (15, 'Pozorno promotrite reakcijsku shemu.', null, null);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (16, 'Pozorno promotrite sliku na kojoj je prikazan kostur čovjeka.', null, 262);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (17, 'Pozorno promotrite sliku na kojoj je prikazan svjetlosni mikroskop korišten za promatranje mikroorganizama prikazanih u vidnome polju.', null, 263);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (18, 'Pozorno promotrite sliku na kojoj je prikazan životni ciklus uhatoga klobuka.', null, 264);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (19, 'Pozorno promotrite sliku na kojoj je prikazana građa stanične membrane.', null, 265);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (20, 'Pozorno promotrite sliku na kojoj je prikazana građa tijela spužve.', null, 266);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (21, 'Pozorno promotrite sliku na kojoj je prikazana jedna vrsta mahovine', null, 267);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (22, 'Pozorno promotrite sliku na kojoj je prikazana ovisnost temperature tijela četiriju vrsta kralježnjaka označenih slovima A, B, C i D o temperaturi okoliša do krajnjih točaka preživljavanja.', null, 268);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (23, 'Pozorno promotrite sliku na kojoj je prikazana promjena broja jedinka dviju različitih životinjskih vrsta označenih slovima A i B koje su živjele odvojeno u istim uvjetima staništa. Vrste su u jednome trenutku premještene u zajedničko stanište koje je imalo iste uvjete kao i prethodna staništa.', null, 269);
INSERT INTO super_questions (id, question, audio_id, img_id) VALUES (24, 'Pozorno promotrite sliku na kojoj su pojednostavljeno prikazani metabolički procesi koji se događaju u stanici zelene alge roda Chlorella. Slovima F, G, H i J označeni su procesi koji se događaju u stanici. Isprekidane linije dijele prikaz na tri vremenski i prostorno odvojena metabolička procesa.', null, 270);
